const cancelMutation = createCancelMutation(cancelToken)

const props = {
  isOpen: true,
  onSelected: action('onSelected'),
  cancelToken,
}

const getImageResponse = (
  url: string,
  getImage: { width: number; height: number; uri: string }
) => ({
  request: {
    query: PictureDialog.queries.getImage,
    variables: {
      url,
      cancelToken,
    },
  },
  result: {
    data: {
      getImage: new ImageSource(getImage),
    },
  },
})

